import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react'
import { Route, Link } from 'react-router-dom';




function TestButton(props) {
  if (props.gender === undefined | props.name === undefined | props.name === '' ) {
    return (
        <button id="first-start" disabled={true}>검사 시작</button>
    )
  } else {
    return (
      <Link to='/example'>
        <button id="first-start">검사 시작</button>
      </Link>
    )
  }
}

function NameWarning(props) {
  if (props.name === undefined | props.name === '') {
    return (
      <p style="color: red">이름을 입력해주세요!</p>
    )
  }
}

function User() {
  const [name, setName] = useState()
  const [gender, setGender] = useState()
  console.log(name)

  function handleChange(event) {
    setName(event.target.value)
    console.log(name)
  }
  function handleClick(event) {
    setGender(event.target.value)
  }

  return (
    <div id="usersetting">
      <h1 id='title'>직업가치관 검사</h1>
      <div id='setting'>
        <div id="name-box">
          <p>이름</p>
          <input id='name' onChange={handleChange}></input>
          <NameWarning name={name} />
        </div>
        <div id='gender-box'>
          <p>성별</p>
          <div id="male-box">
            <input type="radio" id='male' name='gender' value='male' onClick={handleClick} />
            <label htmlFor="male">남자</label>
          </div>
          <div id='female-box'>
            <input type="radio" id='female' name='gender' value='female' onClick={handleClick} />
            <label htmlFor="female">여자</label>
          </div>
        </div>
        <TestButton name={name} gender={gender} />
      </div>
    </div>
  )
}


function App() {
  return (
    <Routes>
      <Route exact path='/' element={<User />} />
      <Route></Route>
      <Route></Route>
    </Routes>
  );
}

export default App;
